input = ''
start = 0
current = 0

unique_char = set()

for ch in input:
    if ch in unique_char:
        while input[start] != ch:
            unique_char.remove(input[start])
            start += 1
        start += 1
    else:
        unique_char.add(ch)

    current += 1
    if current - start == 14:
        break

print(current)
print(input[start:current + 1])
